class Solution {
    public int numberOfEmployeesWhoMetTarget(int[] hours, int target) {
        // Initialize a counter to track the number of employees meeting the target
        int count = 0;

        // Iterate through each employee's hours
        for (int i = 0; i < hours.length; i++) {
            // If the current employee's hours are greater than or equal to the target,
            // increment the counter
            if (hours[i] >= target) {
                count++;
            }
        }

        // Return the total count of employees who met or exceeded the target hours
        return count;
    }
}
